import React from 'react';
import './pagination.scss';


class Pagination extends React.Component {
  render() {
    return (
      <div>
        <h2>Pagination with Rounded Borders</h2>
        <div class="pagination">
          <a href="#">&laquo;</a>
          <a href="#">1</a>
          <a class="active" href="#">2</a>
          <a href="#">3</a>
          <a href="#">4</a>
          <a href="#">5</a>
          <a href="#">6</a>
          <a href="#">&raquo;</a>
        </div>
      </div>
    );
  }
}

export default Pagination;
